import { useEffect, useState } from "react";
import "./App.css";

function App() {
  const [data, changeData] = useState("");

  const getData = async () => {
    const info = await fetch(
      "http://api.weatherapi.com/v1/current.json?key=77f552816a9043c686941503221012&q=London"
    );
    const response = await info.json();
    changeData(response);
  };

  useEffect(() => {
    getData();
  }, []);

  return <div>{data}</div>;
}

export default App;
